  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2013-03-15T11:33:10.551156\",\n\t\"name\": \"key-watersheds-in-the-southeast-coast-im-network-secn-custom-drainage-basin-boundaries\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains custom drainage basin
  polygons that are composed of the various watersheds (HUC-10) or subwatersheds (HUC-12)
  that contain water features that flow or contribute to those that flow directly
  into SECN parks. The drainage basins have attributes that state the HUC-2/Region,
  HUC-4/Subregion, HUC-6/Basin, and HUC-8/Subbasin numbers and names as well as the
  HUC level that each drainage basin is composed of (Watershed or Subwatershed) for
  the particular park that they are associated with. The drainage basin polygons are
  essentially the merged versions of the individual watersheds/subwatersheds that
  they contain. If the individual watershed/subwatershed boundaries within a drainage
  basin are needed, please refer to the dataset titled 'Key Watersheds in the Southeast
  Coast I&M Network (SECN) - Individual Watershed/Subwatershed Boundaries' in order
  to access the individual units that are found within each drainage basin. Note:
  for the purposes of this dataset and for the remainder of this metadata file, the
  term \"watershed\" will refer to individual watershed/subwatershed units while the
  term \"drainage basin\" will refer to the collection of individual watershed/subwatershed
  units that contribute to the condition of each park.\",\n\t\"license_title\": null,\n\t\"extras\":
